import React from 'react'
import { Link } from 'react-router-dom'
import { library } from "@fortawesome/fontawesome-svg-core";
import { fab, faTwitterSquare, faFacebook, faLinkedin, faGithub, faYoutube, faCoffee } from "@fortawesome/free-brands-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
// import { faCheckSquare, faCoffee } from "@fortawesome/free-solid-svg-icons";
library.add(fab, faTwitterSquare, faFacebook, faLinkedin, faGithub, faYoutube, faCoffee );




const Footer = () => {
  return (
    <footer className='footer-center text-white bg-neutral-focus py-4 px-8'>
        <div>
            <div className="inline"> API utiliser dans ce projet </div>
            <a 
                href="https://breakingbadapi.com/documentation"
                target="_blank"
            >
                <p className='text-2xl text-neutral hover:text-green-700 inline ml-2'> Visitez le LIEN </p> 
            </a>
            <FontAwesomeIcon icon="check-square" />
            <FontAwesomeIcon icon="coffee" /> 
            <FontAwesomeIcon icon="fa-brands fa-facebook-f" />

            <FontAwesomeIcon icon={['fab', 'twitter']} />
            <FontAwesomeIcon icon={['fab', 'youtube']} />
            <FontAwesomeIcon icon={['fab', 'facebook']} />
            <FontAwesomeIcon icon={['fab', 'linkedin']} />
            <FontAwesomeIcon icon={['fab', 'github']} />
            <FontAwesomeIcon icon={['fab', 'Coffee']} />
            
        </div>
    </footer>
  )
}

export default Footer
